css:
@-moz-document
	url-prefix('http://www.tumblr.com/'),
	url-prefix('https://www.tumblr.com/')
{

.new_post_label/*_icon*/ > I {display: none !important}
.new_post_label {
  background-clip: content-box;
  padding: 40px 1px 39px 0 !important;
}
.new_post_label:hover > SPAN {
  color: black !important;
  background-color: rgba(192,192,192,.7) !important;
  font-weight: bold !important;
}
.new_post_buttons {
  background: center top no-repeat url('data:image/gif;base64,'),
  center bottom no-repeat url('data:image/gif;base64,') white !important;
}

}
